################################################### LOGIC ##########################################################
.text
.globl main

main:

################################################### START SCREEN ###############################################
start_screen:
    # Set up the arguments for display_image
    la $a0, start_screen_start   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    
    check:
    	li $t9, 0xffff0000
    	lw $t8, 0($t9)
    	beq $t8, 1, keypress
    	j check
     
     keypress:
     	lw $t2, 4($t9)
     	beq $t2, 0x73, start_screen_exit
     	beq $t2, 0x0A, print_level
     	j check

start_screen_exit:
    # Set up the arguments for display_image
    la $a0, start_screen_quit   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    
    check_quit:
    	li $t9, 0xffff0000
    	lw $t8, 0($t9)
    	beq $t8, 1, keypress_quit
    	j check_quit
     
     keypress_quit:
     	lw $t2, 4($t9)
     	beq $t2, 0x77, start_screen
     	beq $t2, 0x0A, exit
     	j check_quit
    
    
    
    
##################################################### LEVEL ONE ###############################################
start_level:
    # Set up the arguments for display_image
    la $a0, level_one   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         
    
    la $t3, CharX
    li $t4, 4
    sw $t4, 0($t3)
    la $t3, OldX
    li $t4, 4
    sw $t4, 0($t3)
    
    la $t3, OldY
    li $t4, 62
    sw $t4, 0($t3)
    la $t3, CharY
    li $t4, 62
    sw $t4, 0($t3)
    
    # Call display_image
    jal display_image
    jal draw_character
    
    j print_hearts


##################################################### LEVEL TWO ###############################################
second_level:
    # Set up the arguments for display_image
    la $a0, level_two   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    la $t3, CharX
    li $t4, 4
    sw $t4, 0($t3)
    
    la $t3, CharY
    li $t4, 62
    sw $t4, 0($t3)
    
    la $t3, OldX
    li $t4, 4
    sw $t4, 0($t3)
    
    la $t3, OldY
    li $t4, 62
    sw $t4, 0($t3)
    
    # Call display_image
    jal display_image
    jal draw_character
    
    # Set screen to 2
    li $t0, 2            # Load the value 2 into $t0
    sw $t0, Screen       # Store the value 2 at the address of Screen
    
    j print_hearts


##################################################### LEVEL THREE ###############################################
third_level:
    # Set up the arguments for display_image
    la $a0, level_three   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    la $t3, CharX
    li $t4, 4
    sw $t4, 0($t3)
    
    la $t3, CharY
    li $t4, 61
    sw $t4, 0($t3)
    
    la $t3, OldX
    li $t4, 4
    sw $t4, 0($t3)
    
    la $t3, OldY
    li $t4, 61
    sw $t4, 0($t3)
    
    # Call display_image
    jal display_image
    jal draw_character
    
    li $t0, 3            # Load the value 3 into $t0
    sw $t0, Screen       # Store the value 3 at the address of Screen
    
    j print_hearts


##################################################### NEXT LEVEL ###############################################
next_level:
    # Increase level by 1
    la $t0, Screen    # Load the address of Screen into $t0
    lw $t1, 0($t0)    # Load the value stored at health into $t1
    addi $t1, $t1, 1  # Increase the value in $t1 by 1
    sw $t1, 0($t0)    # Store the updated value in $t1 back to Screen

print_level:
    lw $t0, Screen        # Load the value of level into $t0

    li $t1, 1            # Load the value 1 into $t1
    beq $t0, $t1, start_level # If level == 1, go to start_level

    li $t1, 2            # Load the value 2 into $t1
    beq $t0, $t1, second_level # If level == 2, go to second_level

    li $t1, 3            # Load the value 3 into $t1
    beq $t0, $t1, third_level  # If level == 3, go to third_level
    
    li $t1, 4            # Load the value 4 into $t1
    beq $t0, $t1, win    # If level == 4, go to the win screen
    
    j game_loop
    
print_hearts:
    # Decrement health by 1
    lw $t0, Health    # Load the address of health into $t0
    
    beq $t0, 3, print_3_hearts
    beq $t0, 2, print_2_hearts
    beq $t0, 1, print_1_heart
    
print_3_hearts:
    # draw it
    # Set up the arguments for display_image
    la $a0, three_hearts    # Replace image_start with the label of the image data in memory
    li $a1, 29           
    li $a2, 11 
    li $t0, 96
    li $t1, 3     

    # Call display_image
    jal display_image
    
    j game_loop
    
print_2_hearts:
    # draw it 
    # Set up the arguments for display_image
    la $a0, two_hearts    # Replace image_start with the label of the image data in memory
    li $a1, 29           
    li $a2, 11 
    li $t0, 96
    li $t1, 3        

    # Call display_image
    jal display_image
    
    j game_loop
    
print_1_heart:
    # draw it
    # Set up the arguments for display_image
    la $a0, one_heart    # Replace image_start with the label of the image data in memory
    li $a1, 29           
    li $a2, 11 
    li $t0, 96
    li $t1, 3        

    # Call display_image
    jal display_image
    
    j game_loop
    
##################################################### GAME LOOP ###############################################
game_loop:
    j check_press

    inner_loop:
	la $t0, character_movement  # Load the address of character_movement array into $t0
    	lw $t7, 0($t0)        	    # Load the value of character_movement[0] into $t1
    	lw $t8, 4($t0)        	    # Load the value of character_movement[1] into $t2
    	lw $t3, 12($t0)        	    # Load the value of character_movement[3] into $t3
    	
    	lw $t0, Screen
    	li $t1, 3            # Load the value 3 into $t1
        beq $t0, $t1, print_fireball  # If level == 3, go to print fireball
        
    	continue:
	bnez $t7, move_left  # If character_movement[0] is not zero, call move_left
    	bnez $t8, move_right # If character_movement[1] is not zero, call move_right
    	
    	game_vertical:
    	la $t0, character_movement  # Load the address of character_movement array into $t0
    	lw $t3, 12($t0)        	    # Load the value of character_movement[3] into $t3
    	bnez $t3, move_down  # If character_movement[3] is not zero, call move_down
    	beqz $t3, move_up    # If character_movement[3] is zero, call move_up
	
	sleep:
	
	jal erase_character # erase character in current position
	jal draw_character
	lw $t0, CharX      # Load the value of "CharX" into register $t0
	lw $t1, CharY      # Load the value of "CharY" into register $t1
	sw $t0, OldX       # Store the value in $t0 to "OldX" in memory
	sw $t1, OldY       # Store the value in $t1 to "OldY" in memory
	
	# Sleep for 40ms 
	li $v0, 32
	li $a0, 40
	syscall
	
	j game_loop
	
	
.include "display.asm"
.include "controls.asm"

################################################### DAMAGE TAKEN ##########################################################
damage_taken:
    # Decrement health by 1
    la $t0, Health    # Load the address of health into $t0
    lw $t1, 0($t0)    # Load the value stored at health into $t1
    addi $t1, $t1, -1 # Decrement the value in $t1 by 1
    beqz $t1, game_over
    sw $t1, 0($t0)    # Store the updated value in $t1 back to health
    
    j print_level



################################################### Exit ##########################################################
game_over:
    # Set up the arguments for display_image
    la $a0, game_over_screen   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    # Exit program
    j check_win
    
win:
    # Set up the arguments for display_image
    la $a0, win_screen   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    
    check_win:
    	li $t9, 0xffff0000
    	lw $t8, 0($t9)
    	beq $t8, 1, keypress_win
    	j check_win
     
     keypress_win:
     	lw $t2, 4($t9)
     	beq $t2, 0x70, respond_to_p
     	j check_win
    
exit:
    # Draw black screen
    # Set up the arguments for display_image
    la $a0, black_screen   # Replace image_start with the label of the image data in memory
    li $a1, 128           
    li $a2, 128  
    li $t0, 0
    li $t1, 0         

    # Call display_image
    jal display_image
    # Exit program
    li $v0, 10
    syscall
   
